import React, { Fragment } from 'react';
import { Button, Container, Nav, Navbar, NavbarBrand, NavLink } from 'react-bootstrap';
import NavbarCollapse from 'react-bootstrap/esm/NavbarCollapse';
import NavbarToggle from 'react-bootstrap/esm/NavbarToggle';
import 'bootstrap/dist/css/bootstrap.min.css';

export default function NavigationBar() {
	return (
		<Fragment>
			<Navbar bg="light" expand="lg">
				<Container>
					<NavbarBrand href=''>Actividades</NavbarBrand>
					<NavbarToggle arial-controls="basic-navbar-nav" />
					<NavbarCollapse id="basic-navbar-nav">
						<Nav className="me-auto">
							<Nav.Link>Pagina principal</Nav.Link>
							<NavLink>Fecha actual</NavLink>
						</Nav>
					</NavbarCollapse>
				</Container>
			</Navbar>
		</Fragment>
	);
}
